/** @format */

import Genre from './Genre';

function SortGenre({ genre }) {
	console.table(genre);
	return (
		<>
			{genre.map((item) => {
				<Genre key={item.genre} genre={item.genre} />;
			})}
		</>
	);
}

export default SortGenre;
